import Head from 'next/head'
import { useState } from 'react'
import { FriendListWrapper } from './Friends.styles'

const Friends = () => {

    const [friends] = useState([
        {
            Name: 'Владислав',
            Surname: 'Самсонов',
            Photo: 'https://sun9-28.userapi.com/impg/1y_m2YWC85fh4zdlyq60cpztFfpcFPogzfdKnw/DIxREY8BCMM.jpg?size=810x1080&quality=96&sign=a7193cb8b0f274a7e9ad2ba08085db8c&type=album',
            id: 1
        },

        {
            Name: 'Александр',
            Surname: 'Иванов',
            Photo: 'https://meragor.com/files/styles//ava_800_800_wm/funny-standoff-_meragor-com_349.jpg',
            id: 2
        }

    ])

    const renderFriends = () => {
        return (
            <>
                <Head>
                    <title>Друзья</title>
                </Head>
                <FriendListWrapper>
                    {friends.map((friend) => (
                        <div key={friend.id}>
                            <img src={friend.Photo} />
                            <h1>{`${friend.Name} ${friend.Surname}`}</h1>
                        </div>
                    ))}
                </FriendListWrapper>
            </>
        )

    }
    
    return renderFriends()
}

export default Friends
